フィッティングにこだわったエセックスニュータイプシートカバー。<BR>
ソフトBioのPVCレザーを使用しているので装着をスムーズにし、最高のフィッティングを演出。<BR>
難燃性、耐久性に優れ抗菌防臭など衛生面もグレードアップ。<BR>
2列目のシートベルト対応でワイドボディも取付け可。<BR>
その他にスーパーGL ハイグレードタイプもご用意しております。<hr>
【適合車名】ハイエース/レジアスエース<br>
【適合型式】TRH/KDH<BR>
【適合年式】2004年～<BR>
